/*Table structure for table `shop_address` */

DROP TABLE IF EXISTS `shop_address`;

CREATE TABLE `shop_address` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '地址ID',
  `member_id` int(10) unsigned DEFAULT '0' COMMENT '会员ID',
  `member_name` varchar(50) DEFAULT NULL COMMENT '会员姓名',
  `province_id` int(11) DEFAULT NULL COMMENT '省份id',
  `city_id` int(11) DEFAULT NULL COMMENT '市级ID',
  `district_id` int(10) unsigned DEFAULT '0' COMMENT '地区ID',
  `full_region` varchar(255) DEFAULT NULL COMMENT '地区内容',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `tel_number` varchar(15) DEFAULT NULL COMMENT '手机电话',
  `post_code` int(11) DEFAULT NULL COMMENT '邮编',
