/*Table structure for table `shop_admin` */

DROP TABLE IF EXISTS `shop_admin`;

CREATE TABLE `shop_admin` (
  `admin_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '管理员ID',
  `admin_name` varchar(20) DEFAULT NULL COMMENT '管理员名称',
  `admin_password` varchar(32) DEFAULT NULL COMMENT '管理员密码',
  `admin_login_num` int(11) DEFAULT '0' COMMENT '登录次数',
  `login_ip` varchar(30) DEFAULT NULL COMMENT '登陆的ip地址',
