/*Table structure for table `shop_adv` */

DROP TABLE IF EXISTS `shop_adv`;

CREATE TABLE `shop_adv` (
  `adv_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '广告自增标识编号',
  `ap_id` int(10) unsigned DEFAULT NULL COMMENT '广告位id',
  `adv_title` varchar(255) DEFAULT NULL COMMENT '广告内容描述',
  `adv_content` varchar(1000) DEFAULT NULL COMMENT '广告内容',
  `adv_start_date` datetime DEFAULT NULL COMMENT '广告开始时间',
  `adv_end_date` datetime DEFAULT NULL COMMENT '广告结束时间',
  `slide_sort` int(10) unsigned DEFAULT NULL COMMENT '幻灯片排序',
  `member_id` int(11) DEFAULT NULL COMMENT '会员ID',
  `member_name` varchar(50) DEFAULT NULL COMMENT '会员用户名',
  `click_num` int(10) unsigned DEFAULT NULL COMMENT '广告点击率',
  `is_allow` int(1) unsigned DEFAULT NULL COMMENT '会员购买的广告是否通过审核0未审核1审核已通过2审核未通过',
  `buy_style` varchar(10) DEFAULT NULL COMMENT '购买方式',
  `goldpay` int(10) unsigned DEFAULT NULL COMMENT '购买所支付的金币',
  PRIMARY KEY (`adv_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='广告表';

