  `click_year` int(5) unsigned DEFAULT '0' COMMENT '点击年份',
  `click_month` int(2) unsigned DEFAULT '0' COMMENT '点击月份',
  `click_num` int(10) unsigned DEFAULT '0' COMMENT '点击率',
  `adv_name` varchar(100) DEFAULT NULL COMMENT '广告名称',
  `ap_name` varchar(100) DEFAULT NULL COMMENT '广告位名称'
