/*Table structure for table `shop_adv_position` */

DROP TABLE IF EXISTS `shop_adv_position`;

CREATE TABLE `shop_adv_position` (
  `ap_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '广告位置id',
  `ap_name` varchar(100) DEFAULT NULL COMMENT '广告位置名',
  `ap_intro` varchar(255) DEFAULT NULL COMMENT '广告位简介',
  `ap_class` int(1) unsigned DEFAULT NULL COMMENT '广告类别：0图片1文字2幻灯3Flash',
  `ap_display` int(1) unsigned DEFAULT NULL COMMENT '广告展示方式：0幻灯片1多广告展示2单广告展示',
  `is_use` int(1) unsigned DEFAULT NULL COMMENT '广告位是否启用：0不启用1启用',
  `ap_width` int(10) DEFAULT NULL COMMENT '广告位宽度',
  `ap_height` int(10) DEFAULT NULL COMMENT '广告位高度',
  `ap_price` int(10) unsigned DEFAULT NULL COMMENT '广告位单价',
  `adv_num` int(10) unsigned DEFAULT NULL COMMENT '拥有的广告数',
