/*Table structure for table `shop_article` */

DROP TABLE IF EXISTS `shop_article`;

CREATE TABLE `shop_article` (
  `article_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '文章编号',
  `article_title` varchar(50) DEFAULT NULL COMMENT '文章标题',
  `article_class_id` int(10) unsigned DEFAULT '0' COMMENT '文章分类编号',
  `article_origin` varchar(50) DEFAULT NULL COMMENT '文章来源',
  `article_origin_address` varchar(255) DEFAULT NULL COMMENT '文章来源链接',
  `article_author` varchar(50) DEFAULT NULL COMMENT '文章作者',
  `article_abstract` varchar(140) DEFAULT NULL COMMENT '文章摘要',
  `article_content` text COMMENT '文章正文',
  `article_image` varchar(255) DEFAULT NULL COMMENT '文章图片',
  `article_keyword` varchar(255) DEFAULT NULL COMMENT '文章关键字',
  `article_link` varchar(255) DEFAULT NULL COMMENT '相关文章',
  `article_goods` text COMMENT '相关商品',
  `article_start_time` int(10) unsigned DEFAULT '0' COMMENT '文章有效期开始时间',
  `article_end_time` int(10) unsigned DEFAULT '0' COMMENT '文章有效期结束时间',
  `article_publish_time` int(10) unsigned DEFAULT '0' COMMENT '文章发布时间',
  `article_click` int(10) unsigned DEFAULT '0' COMMENT '文章点击量',
  `article_sort` int(1) unsigned DEFAULT '0' COMMENT '文章排序0-255',
  `article_commend_flag` int(1) unsigned DEFAULT '0' COMMENT '文章推荐标志0-未推荐，1-已推荐',
  `article_comment_flag` int(1) unsigned DEFAULT '1' COMMENT '文章是否允许评论1-允许，0-不允许',
  `article_verify_admin` varchar(50) DEFAULT NULL COMMENT '文章审核管理员',
  `article_verify_time` int(10) unsigned DEFAULT '0' COMMENT '文章审核时间',
  `article_state` int(1) unsigned DEFAULT '1' COMMENT '1-草稿、2-待审核、3-已发布、4-回收站',
  `article_publisher_name` varchar(50) DEFAULT NULL COMMENT '发布者用户名',
  `article_publisher_id` int(10) unsigned DEFAULT NULL COMMENT '发布者编号',
  `article_attachment_path` varchar(50) DEFAULT NULL COMMENT '文章附件路径',
  `article_image_all` text COMMENT '文章全部图片',
  `article_modify_time` int(10) unsigned DEFAULT '0' COMMENT '文章修改时间',
  `article_tag` varchar(255) DEFAULT NULL COMMENT '文章标签',
  `article_comment_count` int(10) unsigned DEFAULT NULL COMMENT '文章评论数',
  `article_commend_image_flag` int(1) unsigned DEFAULT '0' COMMENT '文章推荐标志(图文)',
  `article_share_count` int(10) unsigned DEFAULT '0' COMMENT '文章分享数',
  `article_verify_reason` varchar(255) DEFAULT NULL COMMENT '审核失败原因',
  PRIMARY KEY (`article_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='CMS文章表';

/*Data for the table `shop_article` */

/*Table structure for table `shop_article_class` */

DROP TABLE IF EXISTS `shop_article_class`;

CREATE TABLE `shop_article_class` (
  `ac_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '索引ID',
  `ac_code` varchar(20) DEFAULT NULL COMMENT '分类标识码',
  `ac_name` varchar(100) DEFAULT NULL COMMENT '分类名称',
  `ac_parent_id` int(10) unsigned DEFAULT '0' COMMENT '父ID',
  `ac_sort` int(1) unsigned DEFAULT '255' COMMENT '排序',
  `is_del` int(1) DEFAULT NULL COMMENT '是否删除,0 不删除 1删除  默认为0',
  `ac_status` int(1) DEFAULT '0' COMMENT '分类状态0:启用;1:停用',
  `created_time` datetime DEFAULT NULL COMMENT '录入时间',
  `updated_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`ac_id`),
  KEY `ac_parent_id` (`ac_parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文章分类表';

/*Data for the table `shop_article_class` */

/*Table structure for table `shop_brand` */

DROP TABLE IF EXISTS `shop_brand`;

CREATE TABLE `shop_brand` (
  `brand_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '索引ID',
  `brand_name` varchar(100) DEFAULT NULL COMMENT '品牌名称',
  `brand_class` varchar(50) DEFAULT NULL COMMENT '类别名称',
  `brand_pic` varchar(100) DEFAULT NULL COMMENT '图片',
  `brand_sort` int(3) unsigned DEFAULT '0' COMMENT '排序',
  `brand_recommend` int(1) DEFAULT '0' COMMENT '推荐，0为否，1为是，默认为0',
  `brand_apply` int(1) DEFAULT '1' COMMENT '品牌申请，0为申请中，1为通过，默认为1，申请功能是会员使用，系统后台默认为1',
  `class_id` int(10) unsigned DEFAULT '0' COMMENT '所属分类id',
  `is_del` int(1) DEFAULT '0' COMMENT '是否删除0:未删除;1:已删除，默认为0',
  `created_time` datetime DEFAULT NULL COMMENT '录入时间',
  `updated_time` datetime DEFAULT NULL COMMENT '更新时间(自更新)',
  PRIMARY KEY (`brand_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='品牌表';

/*Data for the table `shop_brand` */

