/*Table structure for table `shop_express` */

DROP TABLE IF EXISTS `shop_express`;

CREATE TABLE `shop_express` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '索引ID',
  `e_name` varchar(50) DEFAULT NULL COMMENT '公司名称',
  `e_state` int(4) DEFAULT '0' COMMENT '状态',
  `e_code` varchar(50) DEFAULT NULL COMMENT '编号',
  `e_letter` char(1) DEFAULT NULL COMMENT '首字母',
  `e_order` int(4) DEFAULT '0' COMMENT '1常用0不常用',
  `e_url` varchar(100) DEFAULT NULL COMMENT '公司网址',
  `is_del` int(4) DEFAULT '0' COMMENT '删除标记',
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='快递公司';

/*Data for the table `shop_express` */

/*Table structure for table `shop_favorites` */

DROP TABLE IF EXISTS `shop_favorites`;

CREATE TABLE `shop_favorites` (
  `member_id` int(10) unsigned NOT NULL COMMENT '会员ID',
  `fav_id` int(10) unsigned DEFAULT NULL COMMENT '收藏ID',
  `fav_type` varchar(20) DEFAULT NULL COMMENT '收藏类型',
  `fav_time` datetime DEFAULT NULL COMMENT '收藏时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='买家收藏表';

/*Data for the table `shop_favorites` */

/*Table structure for table `shop_front_category` */

DROP TABLE IF EXISTS `shop_front_category`;

CREATE TABLE `shop_front_category` (
  `front_cat_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '类目编号',
  `cat_id` int(11) DEFAULT NULL COMMENT '后台类目编号',
  `cat_name` varchar(50) DEFAULT NULL COMMENT '类目名称',
  `level` int(1) DEFAULT NULL COMMENT '类目级别,最高三级类目',
  `parent_id` int(11) DEFAULT NULL COMMENT '父级类目',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `icon_image` varchar(300) DEFAULT NULL COMMENT '分类图标',
  `url` varchar(300) DEFAULT NULL COMMENT '地址',
  `adv_image` varchar(300) DEFAULT NULL COMMENT '广告图',
  `adv_link` varchar(300) DEFAULT NULL COMMENT '广告链接',
  PRIMARY KEY (`front_cat_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

