/*Table structure for table `shop_goods` */

DROP TABLE IF EXISTS `shop_goods`;

CREATE TABLE `shop_goods` (
  `goods_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品id(SKU)',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名称（+规格名称）',
  `goods_jingle` varchar(50) DEFAULT NULL COMMENT '商品广告词',
  `gc_id` int(10) unsigned DEFAULT NULL COMMENT '商品分类id',
  `brand_id` int(10) unsigned DEFAULT NULL COMMENT '品牌id',
  `goods_price` decimal(12,2) DEFAULT NULL COMMENT '商品价格',
  `goods_marketprice` decimal(12,2) DEFAULT NULL COMMENT '市场价',
  `goods_serial` varchar(50) DEFAULT NULL COMMENT '商家编号',
  `goods_click` int(10) unsigned DEFAULT '0' COMMENT '商品点击数量',
  `goods_salenum` int(10) unsigned DEFAULT '0' COMMENT '销售数量',
  `goods_collect` int(10) unsigned DEFAULT '0' COMMENT '收藏数量',
  `goods_spec` text COMMENT '商品规格序列化',
  `goods_storage` int(10) unsigned DEFAULT '0' COMMENT '商品库存',
  `main_image` varchar(300) DEFAULT NULL COMMENT '商品主图',
  `goods_state` int(3) unsigned DEFAULT '1' COMMENT '商品状态 0下架，1正常，10违规（禁售）',
  `goods_verify` int(3) unsigned DEFAULT '10' COMMENT '商品审核 1通过，0未通过，10审核中',
  `areaid_1` int(10) unsigned DEFAULT NULL COMMENT '一级地区id',
  `areaid_2` int(10) unsigned DEFAULT NULL COMMENT '二级地区id',
  `color_id` int(10) unsigned DEFAULT '0' COMMENT '颜色规格id',
  `transport_id` int(8) unsigned DEFAULT NULL COMMENT '运费模板id',
  `goods_freight` decimal(12,2) unsigned DEFAULT '0.00' COMMENT '运费 0为免运费',
  `goods_vat` int(3) unsigned DEFAULT '0' COMMENT '是否开具增值税发票 1是，0否',
  `goods_commend` int(3) unsigned DEFAULT '0' COMMENT '商品推荐 1是，0否 默认0',
  `evaluation_good_star` int(3) unsigned DEFAULT '5' COMMENT '好评星级',
  `evaluation_count` int(10) unsigned DEFAULT '0' COMMENT '评价数',
  `is_del` int(1) DEFAULT '0' COMMENT '是否删除0:未删除;1:已删除，默认为0',
  `created_time` datetime DEFAULT NULL COMMENT '录入时间',
  `updated_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='商品表';

