CREATE TABLE `shop_goods_attr` (
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `cat_id` int(10) unsigned DEFAULT NULL COMMENT '商品分类id',
  `attr_id` int(10) unsigned DEFAULT NULL COMMENT '属性id',
  `attr_value` text COMMENT '属性值',
  `is_del` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除,0:未删除 1:删除',
  `created_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '录入时间',
  `updated_tiime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品属性表';

