/*Table structure for table `shop_member` */

DROP TABLE IF EXISTS `shop_member`;

CREATE TABLE `shop_member` (
  `member_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员id',
  `member_name` varchar(50) DEFAULT NULL COMMENT '会员名称',
  `member_truename` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `member_avatar` varchar(300) DEFAULT NULL COMMENT '会员头像',
  `member_sex` int(4) DEFAULT '1' COMMENT '会员性别 1.男 2.女',
  `member_birthday` datetime DEFAULT NULL COMMENT '生日',
  `member_password` varchar(128) DEFAULT NULL COMMENT '会员密码',
  `password_salt` varchar(30) DEFAULT NULL COMMENT '密码盐，用于提高会员的密码强度',
  `member_email` varchar(100) DEFAULT NULL COMMENT '会员邮箱',
  `member_login_num` int(11) DEFAULT '1' COMMENT '登录次数',
  `member_time` datetime DEFAULT NULL COMMENT '会员注册时间',
