/*Table structure for table `shop_message` */

DROP TABLE IF EXISTS `shop_message`;

CREATE TABLE `shop_message` (
  `message_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '消息索引id',
  `message_parent_id` int(11) DEFAULT NULL COMMENT '回复短消息message_id',
  `from_member_id` int(11) DEFAULT NULL COMMENT '消息发送人',
  `from_member_name` varchar(100) DEFAULT NULL COMMENT '发信息人用户名',
  `to_member_id` varchar(1000) DEFAULT NULL COMMENT '消息接收人',
  `to_member_name` varchar(100) DEFAULT NULL COMMENT '接收人用户名',
  `message_title` varchar(50) DEFAULT NULL COMMENT '消息标题',
  `message_body` varchar(255) DEFAULT NULL COMMENT '消息内容',
  `message_time` varchar(10) DEFAULT NULL COMMENT '消息发送时间',
  `message_update_time` varchar(10) DEFAULT NULL COMMENT '消息回复更新时间',
  `message_open` int(1) DEFAULT '0' COMMENT '消息打开状态',
  `message_state` int(1) DEFAULT '0' COMMENT '消息状态，0为正常状态，1为发送人删除状态，2为接收人删除状态',
  `message_type` int(1) DEFAULT '0' COMMENT '0为私信、1为系统消息、2为留言',
  `read_member_id` varchar(1000) DEFAULT NULL COMMENT '已经读过该消息的会员id',
  `del_member_id` varchar(1000) DEFAULT NULL COMMENT '已经删除该消息的会员id',
  `message_ismore` int(1) DEFAULT '0' COMMENT '站内信是否为一条发给多个用户 0为否 1为多条',
  PRIMARY KEY (`message_id`),
  KEY `from_member_id` (`from_member_id`),
  KEY `message_ismore` (`message_ismore`),
  KEY `to_member_id` (`to_member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='短消息';

/*Data for the table `shop_message` */

/*Table structure for table `shop_offpay_area` */

DROP TABLE IF EXISTS `shop_offpay_area`;

CREATE TABLE `shop_offpay_area` (
  `area_id` text COMMENT '县ID组合',
  `is_del` int(1) DEFAULT NULL COMMENT '是否删除,0不删除,1删除，默认为0',
  `created_time` datetime DEFAULT NULL COMMENT '录入时间',
  `updated_time` datetime DEFAULT NULL COMMENT '修改时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='货到付款支持地区表';

/*Data for the table `shop_offpay_area` */

/*Table structure for table `shop_order` */

DROP TABLE IF EXISTS `shop_order`;

CREATE TABLE `shop_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单索引id',
  `order_sn` bigint(20) unsigned DEFAULT NULL COMMENT '订单编号',
  `pay_sn` bigint(20) unsigned DEFAULT NULL COMMENT '支付单号',
  `buyer_id` int(11) unsigned DEFAULT NULL COMMENT '买家id',
  `buyer_name` varchar(50) DEFAULT NULL COMMENT '买家姓名',
  `buyer_email` varchar(80) DEFAULT NULL COMMENT '买家电子邮箱',
  `add_time` datetime DEFAULT NULL COMMENT '订单生成时间',
  `payment_code` char(10) DEFAULT NULL COMMENT '支付方式名称代码',
  `payment_time` datetime DEFAULT NULL COMMENT '支付(付款)时间',
  `finnshed_time` datetime DEFAULT NULL COMMENT '订单完成时间',
  `goods_amount` bigint(10) unsigned DEFAULT '0' COMMENT '商品总价格',
  `order_amount` bigint(10) unsigned DEFAULT '0' COMMENT '订单总价格',
  `pd_amount` bigint(10) unsigned DEFAULT '0' COMMENT '预存款支付金额',
  `shipping_fee` bigint(10) unsigned DEFAULT '0' COMMENT '运费',
  `evaluation_state` int(1) DEFAULT '0' COMMENT '评价状态 0未评价，1已评价',
  `order_state` int(2) DEFAULT '10' COMMENT '订单状态：0(已取消)10(默认):未付款;20:已付款;30:已发货;40:已收货;',
  `refund_state` int(1) unsigned DEFAULT '0' COMMENT '退款状态:0是无退款,1是部分退款,2是全部退款',
  `lock_state` int(1) unsigned DEFAULT '0' COMMENT '锁定状态:0是正常,大于0是锁定,默认是0',
  `refund_amount` bigint(10) DEFAULT '0' COMMENT '退款金额',
  `delay_time` datetime DEFAULT NULL COMMENT '延迟时间,默认为0',
  `shipping_code` varchar(50) DEFAULT NULL COMMENT '物流单号',
  `is_del` int(1) DEFAULT NULL,
  `created_time` datetime DEFAULT NULL,
  `updated_time` datetime DEFAULT NULL,
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `shop_order` */

/*Table structure for table `shop_order_common` */

DROP TABLE IF EXISTS `shop_order_common`;

CREATE TABLE `shop_order_common` (
  `order_id` int(11) NOT NULL,
  `shipping_time` datetime DEFAULT NULL COMMENT '配送时间',
  `shipping_express_id` int(1) DEFAULT NULL COMMENT '配送公司ID',
  `evaluation_time` datetime DEFAULT NULL COMMENT '评价时间',
  `evalseller_state` int(1) DEFAULT NULL COMMENT '卖家是否已评价买家',
  `evalseller_time` datetime DEFAULT NULL COMMENT '卖家评价买家的时间',
  `order_message` varchar(300) DEFAULT NULL,
  `order_pointscount` int(11) DEFAULT NULL,
  `voucher_price` int(11) DEFAULT NULL COMMENT '代金券面额',
  `voucher_code` varchar(32) DEFAULT NULL COMMENT '代金券编码',
  `deliver_explain` varchar(255) DEFAULT NULL COMMENT '发货备注',
  `daddress_id` mediumint(9) DEFAULT NULL COMMENT '发货备注',
  `reciver_name` varchar(50) DEFAULT NULL COMMENT '收货人姓名',
  `reciver_info` varchar(500) DEFAULT NULL COMMENT '收货人其它信息',
  `reciver_province_id` int(11) DEFAULT NULL COMMENT '收货人省级ID',
  `invoice_info` varchar(500) DEFAULT NULL COMMENT '发票信息',
  `promotion_info` varchar(500) DEFAULT NULL COMMENT '促销信息备注',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单公共信息\n';

/*Data for the table `shop_order_common` */

/*Table structure for table `shop_order_goods` */

DROP TABLE IF EXISTS `shop_order_goods`;

CREATE TABLE `shop_order_goods` (
  `rec_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单商品表索引id',
  `order_id` int(11) DEFAULT NULL COMMENT '订单id',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品id',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名称',
  `goods_price` decimal(12,2) DEFAULT NULL COMMENT '商品价格',
  `goods_num` int(10) unsigned DEFAULT '1' COMMENT '商品数量',
  `goods_image` varchar(100) DEFAULT NULL COMMENT '商品图片',
  `goods_pay_price` bigint(10) unsigned DEFAULT NULL COMMENT '商品实际成交价',
  `buyer_id` int(10) unsigned DEFAULT '0' COMMENT '买家ID',
  `goods_type` int(1) DEFAULT '1' COMMENT '1默认2团购商品3限时折扣商品4组合套装5赠品',
  `promotions_id` int(10) unsigned DEFAULT '0' COMMENT '促销活动ID（团购ID/限时折扣ID/优惠套装ID）与goods_type搭配使用',
  `commis_rate` int(10) unsigned DEFAULT '0' COMMENT '佣金比例',
  `is_del` int(1) DEFAULT NULL,
  `created_time` datetime DEFAULT NULL,
  `updated_time` datetime DEFAULT NULL,
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单商品表';

/*Data for the table `shop_order_goods` */

/*Table structure for table `shop_order_log` */

DROP TABLE IF EXISTS `shop_order_log`;

CREATE TABLE `shop_order_log` (
  `log_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_id` int(11) DEFAULT NULL COMMENT '订单id',
  `log_msg` varchar(150) DEFAULT NULL COMMENT '文字描述',
  `log_time` datetime DEFAULT NULL COMMENT '处理时间',
  `log_role` char(2) DEFAULT NULL COMMENT '操作角色',
  `log_user` varchar(30) DEFAULT NULL COMMENT '操作人',
  `log_orderstate` int(2) DEFAULT NULL COMMENT '订单状态：0(已取消)10:未付款;20:已付款;30:已发货;40:已收货;',
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单处理历史表';

/*Data for the table `shop_order_log` */

/*Table structure for table `shop_order_pay` */

DROP TABLE IF EXISTS `shop_order_pay`;

CREATE TABLE `shop_order_pay` (
  `pay_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_sn` bigint(20) unsigned DEFAULT NULL COMMENT '支付单号',
  `buyer_id` int(10) unsigned DEFAULT NULL COMMENT '买家ID',
  `api_pay_state` int(1) DEFAULT '0' COMMENT '0默认未支付1已支付(只有第三方支付接口通知到时才会更改此状态)',
  PRIMARY KEY (`pay_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单支付表';

/*Data for the table `shop_order_pay` */

/*Table structure for table `shop_payment` */

DROP TABLE IF EXISTS `shop_payment`;

CREATE TABLE `shop_payment` (
  `payment_id` tinyint(1) unsigned NOT NULL AUTO_INCREMENT COMMENT '支付索引id',
  `payment_code` char(10) DEFAULT NULL COMMENT '支付代码名称',
  `payment_name` char(10) DEFAULT NULL COMMENT '支付名称',
  `payment_config` text COMMENT '支付接口配置信息',
  `payment_state` int(1) DEFAULT '0' COMMENT '接口状态0禁用1启用',
  `is_del` int(1) DEFAULT '0' COMMENT '是否删除0:未删除;1:已删除',
  `created_time` datetime DEFAULT NULL COMMENT '更新时间(自更新)',
  `updated_time` datetime DEFAULT NULL COMMENT '更新时间(自更新)',
  PRIMARY KEY (`payment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付方式表';

/*Data for the table `shop_payment` */

/*Table structure for table `shop_refund_return` */

DROP TABLE IF EXISTS `shop_refund_return`;

CREATE TABLE `shop_refund_return` (
  `refund_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `order_id` int(10) unsigned DEFAULT NULL COMMENT '订单ID',
  `refund_sn` varchar(50) DEFAULT NULL COMMENT '申请编号',
  `buyer_id` int(10) unsigned DEFAULT NULL COMMENT '买家ID',
  `buyer_name` varchar(50) DEFAULT NULL COMMENT '买家会员名',
  `goods_id` int(10) unsigned DEFAULT NULL COMMENT '商品ID,全部退款是0',
  `order_goods_id` int(10) unsigned DEFAULT '0' COMMENT '订单商品ID,全部退款是0',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名称',
  `goods_num` int(10) unsigned DEFAULT '1' COMMENT '商品数量',
  `refund_amount` decimal(12,2) DEFAULT '0.00' COMMENT '退款金额',
  `goods_image` varchar(100) DEFAULT NULL COMMENT '商品图片',
  `order_goods_type` int(1) unsigned DEFAULT '1' COMMENT '订单商品类型:1默认2团购商品3限时折扣商品4组合套装',
  `refund_type` int(1) unsigned DEFAULT '1' COMMENT '申请类型:1为退款,2为退货,默认为1',
  `seller_state` int(1) unsigned DEFAULT '1' COMMENT '卖家处理状态:1为待审核,2为同意,3为不同意,默认为1',
  `refund_state` int(1) unsigned DEFAULT '1' COMMENT '申请状态:1为处理中,2为待管理员处理,3为已完成,默认为1',
  `return_type` int(1) unsigned DEFAULT '1' COMMENT '退货类型:1为不用退货,2为需要退货,默认为1',
  `order_lock` int(1) unsigned DEFAULT '1' COMMENT '订单锁定类型:1为不用锁定,2为需要锁定,默认为1',
  `goods_state` int(1) unsigned DEFAULT '1' COMMENT '物流状态:1为待发货,2为待收货,3为未收到,4为已收货,默认为1',
  `add_time` datetime DEFAULT NULL COMMENT '添加时间',
  `seller_time` datetime DEFAULT NULL COMMENT '卖家处理时间',
  `admin_time` datetime DEFAULT NULL COMMENT '管理员处理时间,默认为0',
  `buyer_message` varchar(300) DEFAULT NULL COMMENT '申请原因',
  `seller_message` varchar(300) DEFAULT NULL COMMENT '卖家备注',
  `admin_message` varchar(300) DEFAULT NULL COMMENT '管理员备注',
  `express_id` tinyint(1) unsigned DEFAULT '0' COMMENT '物流公司编号',
  `invoice_no` varchar(50) DEFAULT NULL COMMENT '物流单号',
  `ship_time` datetime DEFAULT NULL COMMENT '发货时间,默认为0',
  `delay_time` int(10) unsigned DEFAULT '0' COMMENT '收货延迟时间,默认为0',
  `receive_time` int(10) unsigned DEFAULT '0' COMMENT '收货时间,默认为',
  `receive_message` varchar(300) DEFAULT NULL COMMENT '收货备注',
  `commis_rate` int(6) DEFAULT '0' COMMENT '佣金比例',
  `is_del` int(1) DEFAULT '0' COMMENT '是否删除0:未删除;1:已删除',
  `created_time` datetime DEFAULT NULL,
  `updated_time` datetime DEFAULT NULL COMMENT '更新时间(自更新)',
  PRIMARY KEY (`refund_id`)
